import React from 'react'
import './testimonials.css'

const testimonials = () => {
    return (
        <section id='testimonials'>
            <h5>Reviews from clients</h5>
            <h2>Testimonials</h2>
            <article className="testimonial">

            </article>
        </section>
    )
}

export default testimonials
